import "./style/styleButton.css";

function ButtonAgendarModal() {
  return (
    <div id="containerButtonAgendarModal">
      <input
        value="Agendar"
        type="submit"
        id="buttonProximo"
        className="buttonAgendarModal"
      />
    </div>
  );
}

export default ButtonAgendarModal;
